import React from 'react'
import cl from './myTitle.module.scss'

const MyTitle = ({ children, ...styles }) => {
  console.log(...styles)
  return (
    <div className={cl.myTitle} {...styles}>
      {children}
    </div>
  )
}

export default MyTitle
